import { Outlet } from 'react-router-dom';
import Navbar from '../navbar/navbar';

const Layout = () => {
  return (
    <div>
      <Navbar />

      <main className="container mt-4">
        <Outlet />
      </main>
    </div>
  );
};

export default Layout;
